import React from 'react';
import { Route, Redirect } from 'react-router-dom';

const RouteGuard = ({ component: Component, user, }) => (
    <Route render={(props) => (
        user 
            ? <Component {...props} />
            : <Redirect to='/login' />
    )} />
)

export default RouteGuard;
